import React from "react";

function TeamMember(props) {
    return(
        <div className = "col-lg-4 col-md-6 col-sm-6 col-xs-12">
            <div className = "card">
                <img style = {{maxWidth : '100%'}} src = {props.info.img}/>
            
                <div className="card-body center" style = {{backgroundColor : props.info.website ? 'white' : 'gray'}}>
                    <h2 className="text-width"> {props.info.name} </h2>
                    <h5> {props.info.position} </h5>
                    <div> {props.info.phone} </div>
                    <div> {props.info.email} </div>
                    <h6> {props.info.website ? props.info.website :  <br></br> } </h6>
                </div>
            </div>
        </div>
    );
}

export default TeamMember;
